import './Help.css'
import react,{useState} from 'react';
import {Link} from "react-router-dom";
import LeftSignup from '../Signup/LeftSignup';


const helpquery = [
    {
      id: '1',
      question:'How I can host my house ?',
      answer:'Lorem ipsum dolor sit amet consectetur adipisicing elit. Fuga amet placeat perferendis aut facilis ipsum voluptates commodi iusto ratione quod?'
    },
    {
      id: '2',
      question:'How to rent house ?',
      answer:'Lorem ipsum dolor sit amet consectetur adipisicing elit. Fuga amet placeat perferendis aut facilis ipsum voluptates commodi iusto ratione quod?'
    },
    {
      id: '3',
      question:'What about privacy and security ?',
      answer:'Lorem ipsum dolor sit amet consectetur adipisicing elit. Fuga amet placeat perferendis aut facilis ipsum voluptates commodi iusto ratione quod?'
    },
    {
      id: '4',
      question:'Do we have mobile app ?',
      answer:'Lorem ipsum dolor sit amet consectetur adipisicing elit. Fuga amet placeat perferendis aut facilis ipsum voluptates commodi iusto ratione quod?'
    }
  ]

function Help(props) {


  let [firstName,setFirstName] = useState('');
    let [lastName,setLastName] = useState('');
    let [email,setEmail] = useState('');
    let [password,setPassword] = useState('');
    let [phonenumber,setPhonenumber] = useState(''); 

    const setFirstNameHandler = (event) =>{
        setFirstName(event.target.value)
    }  
    const setLastNameHandler = (event) =>{
        setLastName(event.target.value)
    }  
    const setEmailHandler = (event) =>{
        setEmail(event.target.value)
    }  
    const setPasswordHandler = (event) =>{
        setPassword(event.target.value)
    }    
    const setPhonenumberHandler = (event) =>{
        setPhonenumber(event.target.value)
    }  
      
    const submitHandler = (event) =>{
        event.preventDefault();
        
        const UserSignupData = {
            id: Math.random().toString,
            fname : firstName,
            lname : lastName,
            email : email,
            password : password,
            phonenumber : phonenumber
        }

        console.log(UserSignupData);
        // props.onSaveExpense(UserSignupData);

        setFirstName('')
        setLastName('')
        setEmail('')
        setPassword('')
        setPhonenumber('')
    }

  const question = helpquery[0].question;
  const answer = helpquery[0].answer;


  return (
    // <div className="HelpPage">
    //   <div  className="helpPageOuterMaincontainer">
    //     <h2>Frequently Asked Questions</h2>
    //     <div className="HelpMainContainer">
    //         <p>{question}</p><span>ClickMe</span>
    //     </div>
    //     <div className="HelpMainContainer">
    //         <p>Lorem ipsum dolor sit amet consectetur?</p><span>ClickMe</span>
    //     </div>
    //     <div className="HelpMainContainer">
    //         <p>Lorem ipsum dolor sit amet consectetur?</p><span>ClickMe</span>
    //     </div>
    //     <div className="HelpMainContainer">
    //         <p>Lorem ipsum dolor sit amet consectetur?</p><span>ClickMe</span>
    //     </div>
    //   </div>
    //   <LeftSignup></LeftSignup>
    // </div>

    <div className="MainContainer">
        <div className="RightSignupMainContainer">
            <div className="welcomesection">

                <h2>Frequently Asked Questios</h2>
            </div>
            <form onSubmit={submitHandler}>
                <div className="RightSignupFormMainContaner">                   
                    <div className="label__input__styler">
                        <label>
                            Email
                        </label>
                        <br />
                        <input type="email" value={email} onChange={setEmailHandler} placeholder="Enter Email" />
                    </div>
                    <div className="label__input__styler">
                        <label htmlFor="password">
                            Password
                        </label>
                        <br />
                        <input type="text" value={password} onChange={setPasswordHandler} placeholder="Enter Password" />
                    </div>
                    <div className="label__input__styler">
                        <label htmlFor="phone">
                            Phone
                        </label>
                        <br />
                        <input type="text" value={phonenumber} onChange={setPhonenumberHandler} placeholder="Enter Phone Number" />
                    </div>
                    <button type="submit" className="actions">Create Account</button>
                </div>
            </form>
        </div>
        <LeftSignup></LeftSignup>
        </div>
  )
}

export default Help;
